snippet.description:
@MerlinsOldSchoolGarage @FabRats 

The Yellow Submarine has arrived in Lake Havasu City, AZ! Some of the Fab Rats Crew, Paul, Ben, and Hunter come from Utah and bring this gem of a boat that was pulled from Lake Powell! The boat is full of mud and the engine needs to come out to start this restoration! You don't want to miss this. Head over to Fab Rats Youtube channel to see more of the story! 
https://www.youtube.com/c/FabRats

